import React from "react";
import "./Example.css";
import styled from "styled-components";

const Wrapper =styled.div`
    background-color: #fff;
    color: red;
    font-size: 14px;

    @media (min-width: 768px){
        font-size: 16px;
        color:blue;
    }

    @media (max-width: 992px){
        font-size: 18px;
        color: green;
    }

`;

const Example=()=> {
    return (
        <Wrapper>
            <h1>fafafafaf</h1>
            <p>afffffffffffff</p>
        </Wrapper>
    );
  }
  
  export default Example;
